import React, { ReactNode } from "react";
import { Grid, Box, Button, Typography } from "@mui/material";
import { Link } from "react-router-dom";

export default function DisplaySection(props: {
  left: boolean;
  back: string;
  display: string;
  title: string;
  subtitle: string;
  desc: string;
  buttonLink: string;
}) {
  return (
    <Box sx={{ flexGrow: 1, minHeight: "1000px" }} className="parallax">
      <img className="back" src={props.back} alt="" />
      <div className="overlay" />
      <Grid container className="top" alignItems="center">
        {props.left ? (
          <>
            <Grid item sm={12} md={6}>
              <div className="display-img-holder">
                <img
                  className="display-img"
                  src={props.display}
                  alt="Display Image"
                />
              </div>
            </Grid>
            <Grid item sm={12} md={6}>
              <div className="display-info-holder">
                <Typography variant="h2" component="h2">
                  {props.title}
                </Typography>
                <br />
                <br />
                <Typography variant="body2" component="span">
                  {props.subtitle}
                </Typography>
                <br />
                <br />
                <Typography
                  variant="body2"
                  component="span"
                  textAlign={"justify"}
                >
                  {props.desc}
                </Typography>
                <br />
                <br />
                <br />
                <Link to={props.buttonLink} style={{ textDecoration: "none" }}>
                  <Button className="btn" variant="contained" size="large">
                    {props.title}
                  </Button>
                </Link>
              </div>
            </Grid>
          </>
        ) : (
          <>
            <Grid item sm={12} md={6}>
              <Typography variant="h2" component="h2">
                {props.title}
              </Typography>
              <br />
              <br />
              <Typography variant="body2" component="span">
                {props.subtitle}
              </Typography>
              <br />
              <br />
              <Typography variant="body2" component="span">
                {props.desc}
              </Typography>
              <br />
              <br />
              <br />
              <Link to={props.buttonLink} style={{ textDecoration: "none" }}>
                <Button className="btn" variant="contained" size="large">
                  {props.title}
                </Button>
              </Link>
            </Grid>
            <Grid item sm={12} md={6}>
              <div className="display-img-holder">
                <img
                  className="display-img"
                  src={props.display}
                  alt="Display Image"
                />
              </div>
            </Grid>
          </>
        )}
      </Grid>
    </Box>
  );
}
